import React, { useState } from 'react';
import { FaTimes, FaMapMarkerAlt, FaShareAlt, FaHeart, FaPhone, FaGlobe } from 'react-icons/fa';
import './../styles/CategoryLightbox.css';

// --- DATOS ---

const genericBusinessData = { /* ... */ };

const standardButtons = [
  {icon: <FaPhone/>, text: 'Teléfonos'},
  {icon: <FaMapMarkerAlt/>, text: 'Google Maps'},
  {icon: <FaHeart/>, text: 'Favoritos'},
  {icon: <FaGlobe/>, text: 'Sitio Web'},
  {icon: <FaShareAlt/>, text: 'Share'}
];

const destinationsData = {
  monterrey: {
    description: {
      image: '/images/monterrey.webp',
      historia: 'Nació en 1596, se convirtió en la capital industrial de México.',
      cultura: 'Fuerte valor al trabajo y la familia. Destacan la música y el baile norteño.',
      comida: ['Carne Asada', 'Tacos de Trompo', 'Cabrito', 'Machacado con huevo', 'Glorias'],
      transporte: ['Metro y TransMetro', 'Apps: Urbani (para recarga), Uber, Didi.'],
      seguridad: ['Zonas seguras: Centro, San Pedro, zona sur.', 'Tráfico pesado en horas pico.', 'Clima: Veranos muy calurosos.']
    },
    places: [ /* ... (datos de MTY) ... */ ]
  },
  guadalajara: {
    description: {
      image: '/images/guadalajara.webp',
      historia: 'Fundada en 1542, Guadalajara es el epicentro cultural y tecnológico del occidente de México. Cuna de la charrería y el mariachi.',
      cultura: 'Vibrante, con raíces en el mariachi, la charrería y el tequila. Fuerte vida artística y festivales.',
      comida: ['Torta Ahogada', 'Birria', 'Pozole', 'Jericalla'],
      transporte: ['Tren Ligero (SITEUR)', 'Mi Micro Calzada/Periférico', 'Apps: Uber, Didi, InDrive.'],
      seguridad: ['Zonas seguras: Centro Histórico, Chapultepec, Providencia.', 'Tráfico intenso en horas pico.', 'Clima: Templado, con lluvias en verano.']
    },
    places: [ /* ... (datos de GDL) ... */ ]
  },
  cdmx: {
    description: {
      image: '/images/cmdx.webp',
      historia: 'Asentada sobre la antigua Tenochtitlan (fundada en 1325), la CDMX es un mosaico histórico que fusiona el legado prehispánico, colonial y moderno. Ha sido capital desde hace siglos.',
      cultura: 'Un epicentro cultural global. Ofrece una diversidad inmensa de museos, galerías, teatros y eventos. Es un punto de encuentro de tradiciones de todo el país y el mundo.',
      comida: ['Tacos al Pastor', 'Pozole', 'Enchiladas Suizas', 'Sopa de Tortilla'],
      transporte: ['Metro', 'Metrobús', 'Trolebús y RTP', 'Apps: Uber, Didi, y Cabify.'],
      seguridad: ['Zonas seguras: Polanco, Condesa, Roma, Coyoacán, Centro Histórico (día).', 'Tráfico sumamente denso.', 'Altitud: 2,200+ metros.', 'Precaución en transporte público.']
    },
    places: [ /* ... (datos de CDMX) ... */ ]
  },
  cancun: {
    description: { /* ... (placeholder) ... */ },
    places: [
        { id: 401, name: 'BENAZUZA COCINA TECNOEMOCIONAL CANCUN', image: '/images/placeholder.webp', rating: 4, price: '$', status: 'Abierto', buttons: standardButtons },
        { id: 402, name: 'PLAYA DELFINES CANCUN', image: '/images/placeholder.webp', rating: 5, price: 'Gratuito', buttons: standardButtons },
        { id: 403, name: 'TOMORROWLAND TULUM 2025', image: '/images/placeholder.webp', date: 'Finalizado', countdown: 'Finalizado', buttons: standardButtons },
    ]
  },
  palenque: { description: { /* ... */ }, places: [] },
  puertoVallarta: { description: { /* ... */ }, places: [] },
  veracruz: { description: { /* ... */ }, places: [] }
};

// --- COMPONENTES ---

const Rating = ({ count }) => (
  <div className="rating">
    {[...Array(5)].map((_, i) => (
      <span key={i} className={i < count ? 'filled' : ''}>★</span>
    ))}
  </div>
);

const CategoryLightbox = ({ isOpen, onClose, category }) => {
  const [activeTab, setActiveTab] = useState('monterrey');

  if (!isOpen) return null;

  const data = category === 'destinos' ? destinationsData : genericBusinessData;
  const activeCityData = data[activeTab];

  const renderTabContent = () => { /* ... (sin cambios) ... */ };

  return (
    <div className="category-lightbox-overlay" onClick={onClose}>
      <div className="category-lightbox-container" onClick={(e) => e.stopPropagation()}>
        <div className="category-lightbox-header">
          <h2>{category}</h2>
          <button onClick={onClose} className="close-button"><FaTimes /></button>
        </div>
        <div className="category-lightbox-tabs">
          <button className={activeTab === 'monterrey' ? 'active' : ''} onClick={() => setActiveTab('monterrey')}>Monterrey</button>
          <button className={activeTab === 'guadalajara' ? 'active' : ''} onClick={() => setActiveTab('guadalajara')}>Guadalajara</button>
          <button className={activeTab === 'cdmx' ? 'active' : ''} onClick={() => setActiveTab('cdmx')}>CDMX</button>
          <button className={activeTab === 'cancun' ? 'active' : ''} onClick={() => setActiveTab('cancun')}>Cancún</button>
          <button className={activeTab === 'palenque' ? 'active' : ''} onClick={() => setActiveTab('palenque')}>Palenque</button>
          <button className={activeTab === 'puertoVallarta' ? 'active' : ''} onClick={() => setActiveTab('puertoVallarta')}>Puerto Vallarta</button>
          <button className={activeTab === 'veracruz' ? 'active' : ''} onClick={() => setActiveTab('veracruz')}>Veracruz</button>
        </div>
        <div className="category-lightbox-content">
          {renderTabContent()}
        </div>
        <div className="category-lightbox-footer">
            <button>Explorar más</button>
            <button>Ver Directorio Completo</button>
            <button>Otros destinos</button>
        </div>
      </div>
    </div>
  );
};

export default CategoryLightbox;
